import './assets/scss/style.scss';
import './assets/scss/_responsive.scss';
import '@fortawesome/fontawesome-free';
window.$ = require('jquery');
import { TimelineLite, Power1, SteppedEase, TweenMax, TweenLite, Power3, Power4 } from 'gsap';
import ScrollMagic from 'scrollmagic';
require('scrollmagic/scrollmagic/uncompressed/plugins/animation.gsap');
require('scrollmagic/scrollmagic/uncompressed/plugins/debug.addIndicators');

function isMobile() {
    return $('.is-mobile').css('display') == 'none';
}

function getWidthMaster() {
    return isMobile() ? '370px' : '580px';
}

function getWidthNew() {
    return isMobile() ? '370px' : '320px';
}

$(document).ready(function() {
    /* --------------Timeline Fullpage-------------*/
    const reloaderLogo = $('.reloader svg');
    const reloaderText = $('.reloader h3');
    const reloader = $('.reloader');

    const MasterNew = $('.master-new');
    const charMaster = $('#master');
    const charNew = $('#new');
    const hello = $('.hello');
    const eye2 = $('text#eye2');
    const dot1 = $('#dot1');
    const dot2 = $('#dot2');
    const mouth = $('#mouth')
    // Timeline full page
    const tl = new TimelineLite();
    tl
        .from(charMaster, 1, {y: 50, autoAlpha: 0, ease: Power1.easeOut})
        .from(charNew, 0.7, {y: 50, autoAlpha: 0, ease: Power1.easeOut})
        .to(charMaster, 0.5, {width: getWidthMaster(), ease: Power1.easeIn})
        .to(charNew, 0.5, {width: getWidthNew(), ease: Power1.easeIn})
        .to(MasterNew, 0.5, {css : {color: 'rgba(0,0,0,.05)'}, ease: Power4.easeOut}, '-=0.2')
        .to(MasterNew, 0.5, {css : {left: '0%'}, ease: Power4.easeIn})
        .from(hello, 1, {autoAlpha: 0, rotation:90, transformOrigin:"right 50%"}, '-=0.2')
        .fromTo(eye2, 0.5, {autoAlpha: 0}, {autoAlpha: 1})
        .fromTo(dot1, 0.5, {autoAlpha: 0}, {autoAlpha: 1})
        .fromTo(dot2, 0.5, {autoAlpha: 0}, {autoAlpha: 1}, '-=0.5')
        .fromTo(mouth, 0.5, {autoAlpha: 0}, {autoAlpha: 1})


    // tl.to(reloaderText, 0.8, { autoAlpha: 0 }, '+=1.8')
        // .to(reloaderLogo, 0.8, { y: -20, autoAlpha: 0 }, '-=0.8')
        // .to(reloader, 0.8, { autoAlpha: 0 }, '-=0.8');
    /* --------------Timeline Fullpage-------------*/

    // Controller scrollmagic
    const controller = new ScrollMagic.Controller();

    /* --------------Home Scence-------------*/
    const typingJob = $('.typing-job');
    const buttonCTA = $('.cta');
    const typingName = $('.typing-name');
    // Timeline home
    const tlHome = new TimelineLite({ paused: true });
    // tlHome
    //     .fromTo(
    //         typingName,
    //         0.5,
    //         { width: '0', y: 200 },
    //         { width: widthTypingName(), ease: SteppedEase.config(37) },
    //         '+=2'
    //     )
    //     .to(typingName, 0.8, { y: 0 })
    //     .fromTo(
    //         typingJob,
    //         0.5,
    //         { autoAlpha: 0 },
    //         { autoAlpha: 1, ease: SteppedEase.config(37) }
    //     )
    //     .fromTo(buttonCTA, 1, { autoAlpha: 0, y: 200 }, { autoAlpha: 1, y: 0, ease: Power1.easeOut }, '-=0.2');
    // Scene home
    const homeScene = new ScrollMagic.Scene({
        triggerHook: 0.9,
        triggerElement: '.home',
        duration: '100%'
    }).addTo(controller);
    homeScene.on('enter', function() {
        // tlHome.play();
    });
    /* --------------Home Scence-------------*/

    /* --------------Portfolio Scence-------------*/
    const typingPortfolio = $('.typing-portfolio');

    const textPortfolio = $('.text-portfolio');
    // Timeline portfolio
    const tlPortfolio = new TimelineLite({ paused: true });
    tlPortfolio
        .fromTo( typingPortfolio, 1, { width: '0' }, { width: '240px', ease: SteppedEase.config(37) }, 0 )
        .fromTo(
            typingPortfolio,
            0.5,
            { 'border-right-color': 'rgba(255,255,255,0.75)' },
            {
                'border-right-color': 'rgba(255,255,255,0)',
                repeat: 2,
                ease: SteppedEase.config(37)
            },
            0
        )
        .fromTo(textPortfolio, 1, { autoAlpha: 0 }, { autoAlpha: 1 }, '-=1');
    // Scene portfolio
    const portfolioScene = new ScrollMagic.Scene({
        triggerHook: 1,
        triggerElement: '.portfolio',
        duration: '50%'
    }).addTo(controller);
    portfolioScene.on('enter', function() {
        tlPortfolio.play();
    });
    /* --------------End Portfolio Scence-------------*/

    /* --------------Projects Scence-------------*/
    new ScrollMagic.Scene({
        triggerElement: '.project.project2',
        triggerHook: 'onEnter',
        duration: '100%'
    })
    .setPin('.projects-page .project.project1 .pin-wrapper', {
        pushFollowers: false
    })
    .addTo(controller);

    new ScrollMagic.Scene({
        triggerElement: '.project.project2',
        triggerHook: 'onEnter',
        duration: '200%'
    })
    .setPin('.projects-page .project.project2 .pin-wrapper', {
        pushFollowers: false
    })
    .addTo(controller);

    new ScrollMagic.Scene({
        triggerElement: '.project.project3',
        triggerHook: 'onEnter',
        duration: '100%'
    })
    .setPin('.projects-page .project.project3 .pin-wrapper', {
        pushFollowers: false
    })
    .addTo(controller);
    /* --------------End Projects Scence-------------*/

    /* --------------Skills Scence-------------*/
    const skills = $('.skill-level');
    const typingSkills = $('.typing-skills');
    const tlSkills = new TimelineLite({paused: true});
    tlSkills
        .fromTo( typingSkills, 1, { width: '0' }, { width: '340px', ease: SteppedEase.config(37) }, 0 )
        .fromTo(
            typingSkills,
            0.5,
            { 'border-right-color': 'rgba(255,255,255,0.75)' },
            {
                'border-right-color': 'rgba(255,255,255,0)',
                repeat: 2,
                ease: SteppedEase.config(37)
            },
            0
        )
        .staggerFrom(skills, 1, { width: 0, ease: Power1.easeIn }, 0.2, '-=1.5')
    const skillScene = new ScrollMagic.Scene({
        triggerHook: 1,
        triggerElement: '.skills',
        duration: '50%'
    })
    .addTo(controller);
    skillScene.on('enter', function() {
        tlSkills.play();
    })
    /* --------------End Skills Scence-------------*/

    /* --------------Navigation-------------*/
    const buttonCloseNav = $('#navigation .button');
    const buttonOpenNav = $('.button-open-navigation');
    const navigation = $('#navigation');
    const navItems = $('#navigation ul li');
    // Open navigation
    buttonOpenNav.click(function() {
        let tl = new TimelineLite();
        tl
            .to(navigation, 0.5, { x: -250, ease: Power1.easeOut })
            .staggerFromTo(navItems, 0.5, {x: 30, autoAlpha: 0}, {x: 0, autoAlpha: 1}, 0.2, '-=0.3')
    });
    // Close navigation
    buttonCloseNav.click(function() {
        let tl = new TimelineLite();
        tl
            .staggerFromTo(navItems, 0.5, {x: 0, autoAlpha: 1}, {x: 30, autoAlpha: 0}, 0.2, '-=0.3')
            .to(navigation, 0.5, { x: 0, ease: Power1.easeIn }, '-=0.5');
    });

    navItems.click(function() {
        $('#navigation ul li a').removeClass('active');
        $(this).children('a').addClass('active');
    })
    /* --------------End Navigation-------------*/
});
